    fun extractEarthquakes() : List<Quake> {
       var listQuakes  = mutableListOf<Quake>()
        try {
            val baseJsonReponse = JSONObject(STRING_JSON)
            var earthQuakeArray = baseJsonReponse.getJSONArray("features")
            for ( index in IntArray(earthQuakeArray.length(),{ i -> i})) {
                val currentEarthQuake = earthQuakeArray.getJSONObject(index)
                val property = currentEarthQuake.getJSONObject("properties")
                val place = property.getString("place")
                val mag = property.getString("mag")
                val time = property.getLong("time")
                val quake = Quake(mag,place,time)
                listQuakes.add(quake)
            }
        } catch (e : JSONException) {
            // If an error is thrown when executing any of the above statements in the "try" block,
            // catch the exception here, so the app doesn't crash. Print a log message
            // with the message from the exception.
            Log.e("QueryUtils", "Problem parsing the earthquake JSON results", e);
        }
        return listQuakes
    }
